&lt;!-- DEBUG-VIEW START 1 APPPATH\Views\auth\login.php --&gt;
&lt;!-- &lt;div class=&quot;container mt-5&quot;&gt;
  &lt;h2 class=&quot;text-center mb-4&quot;&gt;Login&lt;/h2&gt;

  
  &lt;form action=&quot;http://localhost/esim/public/index.php/login/submit&quot; method=&quot;post&quot;&gt;
    &lt;div class=&quot;mb-3&quot;&gt;
      &lt;label for=&quot;email&quot; class=&quot;form-label&quot;&gt;Email address&lt;/label&gt;
      &lt;input type=&quot;email&quot; class=&quot;form-control&quot; name=&quot;email&quot; id=&quot;email&quot; required&gt;
    &lt;/div&gt;

    &lt;div class=&quot;mb-3&quot;&gt;
      &lt;label for=&quot;password&quot; class=&quot;form-label&quot;&gt;Password&lt;/label&gt;
      &lt;input type=&quot;password&quot; class=&quot;form-control&quot; name=&quot;password&quot; id=&quot;password&quot; required&gt;
    &lt;/div&gt;

    &lt;button type=&quot;submit&quot; class=&quot;btn btn-primary w-100&quot;&gt;Login&lt;/button&gt;
  &lt;/form&gt;
&lt;/div&gt; --&gt;


&lt;div
      class=&quot;container d-flex justify-content-center align-items-center my-4&quot;
    &gt;
    
      &lt;div class=&quot;card p-4 shadow-lg&quot; style=&quot;width: 100%; max-width: 400px&quot;&gt;
        &lt;h3 class=&quot;text-center mb-4&quot;&gt;Login&lt;/h3&gt;
        
        &lt;form class=&quot;needs-validation&quot; action=&quot;http://localhost/esim/public/index.php/login/submit&quot; method=&quot;POST&quot; novalidate&gt;
                                   &lt;div class=&quot;mb-3&quot;&gt;
            &lt;label for=&quot;email&quot; class=&quot;form-label&quot;&gt;Email address&lt;/label&gt;
            &lt;input type=&quot;email&quot; class=&quot;form-control&quot; name=&quot;email&quot; id=&quot;email&quot; required /&gt;
            &lt;div class=&quot;invalid-feedback&quot;&gt;
              Please enter a valid email address.
            &lt;/div&gt;
          &lt;/div&gt;
          &lt;div class=&quot;mb-3&quot;&gt;
            &lt;label for=&quot;password&quot; class=&quot;form-label&quot;&gt;Password&lt;/label&gt;
            &lt;input
              type=&quot;password&quot;
              class=&quot;form-control&quot;
              id=&quot;password&quot;
              name=&quot;password&quot; 
              minlength=&quot;6&quot;
              required
            /&gt;
            &lt;div class=&quot;invalid-feedback&quot;&gt;
              Password must be at least 6 characters long.
            &lt;/div&gt;
          &lt;/div&gt;
          &lt;button
            style=&quot;background-color: #001c34&quot;
            type=&quot;submit&quot;
            class=&quot;btn btn-primary w-100 border-none&quot;
          &gt;
            Login
          &lt;/button&gt;
        &lt;/form&gt;

        &lt;!-- Register link below the form --&gt;
        &lt;div class=&quot;text-center mt-3&quot;&gt;
          &lt;p&gt;
            Don&#039;t have an account?
            &lt;a href=&quot;http://localhost/esim/public/index.php/register&quot;&gt;Register here&lt;/a&gt;
          &lt;/p&gt;
        &lt;/div&gt;
      &lt;/div&gt;
    &lt;/div&gt;

    &lt;!-- Bootstrap JS --&gt;
    &lt;script src=&quot;https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js&quot;&gt;&lt;/script&gt;

    &lt;!-- Custom JS for Validation --&gt;
    &lt;script&gt;
      // Bootstrap validation
      (() =&gt; {
        &quot;use strict&quot;;
        const forms = document.querySelectorAll(&quot;.needs-validation&quot;);
        Array.from(forms).forEach((form) =&gt; {
          form.addEventListener(
            &quot;submit&quot;,
            (event) =&gt; {
              if (!form.checkValidity()) {
                event.preventDefault();
                event.stopPropagation();
              }
              form.classList.add(&quot;was-validated&quot;);
            },
            false
          );
        });
      })();
    &lt;/script&gt;
&lt;!-- DEBUG-VIEW ENDED 1 APPPATH\Views\auth\login.php --&gt;
